// import './App.css';


import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
// import RespondentTravelProfile from './RespondentTravelProfile';
import RespondentTravelProfile from './home';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/">
            <RespondentTravelProfile />
          </Route>
          <Route path="/home">
            <Page2 />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
